import React from "react";
import "./Login.css";

function Login() {
  return (
    <>
      <div className="container">
        <div className="card ">
          <form>
            <div className="form-group">
              <div className="row ">
                <div className="col-lg-12 col-md-12 col-sm-12">
                <label for="exampleInputEmail1">Enter the code</label>
                </div>
              </div>
              <div className="row">
              <div className="col-lg-12 col-md-12 col-sm-12">
              <input class="form-control" id="exampleInputEmail1" placeholder="Enter the code" />
              </div>
              </div>
              <div className="row">
              {/* <button type="button" className="btn btn-secondary btn-block"> LOGIN </button> */}
              </div>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}

export default Login;
